import { Box, Button, TextField } from "@material-ui/core";
import axios from "axios";
import { useContext, useEffect, useState } from "react";
import { AuthenticationContext } from "../../../AuthenticationProvider";

interface UserType {
  name: string;
  email: string;
  password: string;
  _id?: string;
}
const Profile = () => {
  const valueOf = useContext(AuthenticationContext);
  console.log(valueOf);

  const [user, setUser] = useState<UserType>({});

  useEffect(() => {
    axios
      .get("/auth")
      .then(({ data }) => {
        console.log(data);
        setUser(data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <Box m={5}>
      <TextField
        variant="outlined"
        margin="normal"
        label="Name"
        type="text"
        fullWidth
        defaultValue={user.name}
      />
      <TextField
        variant="outlined"
        margin="normal"
        label="Email Address"
        type="text"
        fullWidth
        defaultValue={user.email}
      />
      <TextField
        variant="outlined"
        margin="normal"
        label="Password"
        type="text"
        fullWidth
      />

      <Button color="primary" variant="contained">
        Update
      </Button>
    </Box>
  );
};

export default Profile;
